import * as React from 'react';
import {Card, Page} from '@shopify/polaris';
import BaseService from "../../commons/services/BaseService";
import {useEffect, useState} from "react";
import {getListUser, IResListUser} from "../../api/User";
import './index.scss';

const ListUser: React.FC<any> = () => {

    const [listUser, setListUser] = useState<IResListUser[]>([]);

    const getUsers = async () => {
        const res = await getListUser('https://fakestoreapi.com/users?page=0&limit=5');
        if (res.status === 200) {
            setListUser(res.body);
        }
    }

    useEffect(() => {
        getUsers()
    }, []);

    return (
        <Page
            narrowWidth
            breadcrumbs={[{content: 'Orders', url: '/register'}]}
            title="Add payment method"
            pagination={{
                hasPrevious: false,
                hasNext: true,
            }}
        >
            {
                listUser.map(value => {
                    return (
                        <Card sectioned title="Variants" actions={[{content: 'Add variant'}]}>
                            <p>
                                Add variants if this product comes in multiple versions, like different
                                sizes or colors.
                            </p>
                        </Card>
                    )
                })
            }
        </Page>
    )
}

export default ListUser;
